import React, { Component } from 'react';
import Header from '../../layouts/frontend/Header';
import Navbar from '../../layouts/frontend/Navbar';
import ScrollButton from '../../layouts/frontend/ScrollButton';
import Footer from './Footer';

class Home extends Component {
    render() {
        return (
            <div>
                <Navbar />
                <Header />
                <h1>I am Home </h1>
                <div>Lorem ipsum dolor sit amet consectetur adipisicing elit. Error dolore unde officiis molestiae mollitia iusto dolorum, temporibus, voluptates dolores modi dolor, inventore pariatur libero a quod culpa et doloremque soluta.</div>
                <ScrollButton />
                <Footer/>
            </div>
        );
    }
}

export default Home;
